DROP TABLE IF EXISTS `wx_admin_menu`;
CREATE TABLE `wx_admin_menu` (
  `id` varchar(32) NOT NULL DEFAULT '',
  `pid` varchar(32) NOT NULL DEFAULT '' COMMENT '菜单对应权限ID',
  `level` tinyint(3) NOT NULL DEFAULT '1' COMMENT '菜单等级',
  `pmid` varchar(32) NOT NULL DEFAULT '' COMMENT '父菜单id，空为一级菜单',
  `is_show` tinyint(3) NOT NULL DEFAULT '1' COMMENT '是否显示,1显示，0不显示',
  `name` varchar(255) NOT NULL DEFAULT '' COMMENT '菜单名',
  `url` varchar(255) NOT NULL DEFAULT '' COMMENT '菜单路径',
  `icon` varchar(255) NOT NULL DEFAULT '' COMMENT '图标',
  `seq` bigint(13) unsigned NOT NULL DEFAULT '1000' COMMENT '排序',
  `add_time` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '添加时间',
  `d_status` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '标识数据状态，0正常，4删除',
  `d_insert` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '插入日期',
  `d_insertms` bigint(13) unsigned NOT NULL DEFAULT '0' COMMENT '插入的时间毫秒数',
  `d_update` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '更新日期',
  `d_updatems` bigint(13) unsigned NOT NULL DEFAULT '0' COMMENT '更新的时间毫秒数',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

