#
# Structure for table "wx_admin_user"
#

DROP TABLE IF EXISTS `wx_admin_user`;
CREATE TABLE `wx_admin_user` (
  `id` varchar(32) NOT NULL DEFAULT '',
  `gid` varchar(1024) NOT NULL DEFAULT '' COMMENT '用户组',
  `ext_pids` varchar(1024) NOT NULL DEFAULT '' COMMENT '扩展权限',
  `account` varchar(32) NOT NULL DEFAULT '' COMMENT '管理员登陆账号',
  `salt` varchar(32) NOT NULL DEFAULT '',
  `password` varchar(32) NOT NULL DEFAULT '' COMMENT '管理员登陆密码',
  `name` varchar(255) NOT NULL DEFAULT '' COMMENT '管理员名称',
  `is_founder` tinyint(3) NOT NULL DEFAULT '0' COMMENT '是否超级管理员,1是，0否',
  `header_img` varchar(255) NOT NULL COMMENT '管理员头像',
  `is_forbidden` tinyint(3) NOT NULL DEFAULT '0' COMMENT '是否禁用,1是，0否',
  `reg_time` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '注册时间',
  `reg_ip` varchar(15) NOT NULL DEFAULT '' COMMENT '注册ip',
  `last_login_time` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '最后登录时间',
  `last_login_ip` varchar(15) NOT NULL DEFAULT '' COMMENT '最后登陆ip',
  `status` tinyint(3) NOT NULL DEFAULT '0' COMMENT '账号状态，0为正常，1为待开放，2为封锁',
  `add_time` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '添加时间',
  `d_status` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '标识数据状态，0正常，4删除',
  `d_insert` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '插入日期',
  `d_insertms` bigint(13) unsigned NOT NULL DEFAULT '0' COMMENT '插入的时间毫秒数',
  `d_update` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '更新日期',
  `d_updatems` bigint(13) unsigned NOT NULL DEFAULT '0' COMMENT '更新的时间毫秒数',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

