  `seq` int(3) NOT NULL DEFAULT '1000',
  `d_status` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '标识数据状态，0正常，4删除',
  `d_insert` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '插入日期',
