#
# Structure for table "wx_user"
#

DROP TABLE IF EXISTS `wx_user`;
CREATE TABLE `wx_user` (
  `id` varchar(32) NOT NULL DEFAULT '',
  `gid` varchar(32) NOT NULL DEFAULT '' COMMENT '用户组id',
  `account` varchar(32) NOT NULL DEFAULT '' COMMENT '用户的账号，非微信账号',
  `phone` varchar(15) NOT NULL DEFAULT '' COMMENT '用户手机号',
  `salt` varchar(32) NOT NULL DEFAULT '',
  `password` varchar(32) NOT NULL DEFAULT '' COMMENT '用户密码，非微信密码',
  `subscribe` tinyint(3) NOT NULL DEFAULT '1' COMMENT '是否订阅，0为否（无法获取用户信息）,1为是',
  `openid` varchar(255) NOT NULL DEFAULT '' COMMENT '普通用户的标识，对当前公众号唯一',
  `nickname` varchar(255) NOT NULL DEFAULT '' COMMENT '用户名',
  `sex` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '用户的性别，值为1时是男性，值为2时是女性，值为0时是未知',
  `language` varchar(32) NOT NULL DEFAULT 'zh-CN' COMMENT '用户的语言，zh_CN 简体，zh_TW 繁体，en 英语，默认为zh-CN',
  `city` varchar(64) NOT NULL DEFAULT '' COMMENT '所在城市',
  `province` varchar(64) NOT NULL DEFAULT '' COMMENT '所在省份',
  `country` varchar(64) NOT NULL DEFAULT '' COMMENT '所在国家',
  `headimgurl` varchar(500) NOT NULL DEFAULT '' COMMENT '用户头像，最后一个数值代表正方形头像大小（有0、46、64、96、132数值可选，0代表640*640正方形头像），用户没有头像时该项为空。若用户更换头像，原有头像URL将失效。',
  `subscribe_time` bigint(13) unsigned NOT NULL DEFAULT '0' COMMENT '用户关注时间，为时间戳。如果用户曾多次关注，则取最后关注时间',
  `unionid` varchar(255) NOT NULL DEFAULT '' COMMENT '只有将公众号绑定到微信开放平台帐号后，才会出现该字段。确保用户在多个公众号的唯一',
  `remark` varchar(64) NOT NULL DEFAULT '' COMMENT '公众号运营者对粉丝的备注，公众号运营者可在微信公众平台用户管理界面对粉丝添加备注',
  `groupid` varchar(64) NOT NULL DEFAULT '' COMMENT '用户所在的分组ID（兼容旧的用户分组接口）',
  `tagid_list` varchar(64) NOT NULL DEFAULT '' COMMENT '用户被打上的标签ID列表(数组)',
  `status` tinyint(3) NOT NULL DEFAULT '0' COMMENT '账号状态，0为正常，1为封号',
  `add_time` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '添加时间',
  `d_status` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '标识数据状态，0正常，4删除',
  `d_insert` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '插入日期',
  `d_insertms` bigint(13) unsigned NOT NULL DEFAULT '0' COMMENT '插入的时间毫秒数',
  `d_update` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '更新日期',
  `d_updatems` bigint(13) unsigned NOT NULL DEFAULT '0' COMMENT '更新的时间毫秒数',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

